// 该文件专门用于创建整个应用的路由器
import VueRouter from 'vue-router'
//引入组件
import AboutName from '../components/AboutName'
import HomeName from '../components/HomeName'

//创建并暴露一个路由器
export default new VueRouter({
	routes:[
		{
			path:'/about',
			component:AboutName
		},
		{
			path:'/home',
			component:HomeName
		}
	]
})
